// Home page
import React from "react";
import {BrowserRouter as Router, Route, Routes, Link} from 'react-router-dom'
import Patient from './Patient.js'
import Login from './Login.js'
//import { useEffect, useState } from "react";

function Home() {
  return (
    <div className="Home">
      <h2>Welcome to Progenics!</h2>
      <h6>Please navigate below</h6>
      <link to="/login">
        <button className="HomeButtons">Login</button>
      </link>
      <button className="HomeButtons">Submit registration form</button>
      <Router>
        <Routes>
          <Route path='/login' element={<Login/>}/> {/* The "/" means this is route for the main entry point of website */}
          <Route path='/login' element={<Login/>}/>
        </Routes>

      </Router>
    </div>
  );
}

export default Home;
